package com.netdoers.com.dto;

public class PatientShareDetailsDTO {
	
	String _id;
	String patientId;
	String contactType;
	String contactName;
	String contactNumber;
	String status;
	
	public PatientShareDetailsDTO() {
		super();
		// TODO Auto-generated constructor stub
	}
	
	public PatientShareDetailsDTO(String _id, String patientId,
			String contactType, String contactName, String contactNumber,
			String status) {
		super();
		this._id = _id;
		this.patientId = patientId;
		this.contactType = contactType;
		this.contactName = contactName;
		this.contactNumber = contactNumber;
		this.status = status;
	}
	
	public String get_id() {
		return _id;
	}
	public void set_id(String _id) {
		this._id = _id;
	}
	public String getPatientId() {
		return patientId;
	}
	public void setPatientId(String patientId) {
		this.patientId = patientId;
	}
	public String getContactType() {
		return contactType;
	}
	public void setContactType(String contactType) {
		this.contactType = contactType;
	}
	public String getContactName() {
		return contactName;
	}
	public void setContactName(String contactName) {
		this.contactName = contactName;
	}
	public String getContactNumber() {
		return contactNumber;
	}
	public void setContactNumber(String contactNumber) {
		this.contactNumber = contactNumber;
	}
	public String getStatus() {
		return status;
	}
	public void setStatus(String status) {
		this.status = status;
	}
}
